window.bookSummaryJSON = "<p>Kelyn of Ketura: daughter of a legendary warrior who left the mountains before she was born. Brave. Strong. Tempered by her struggle to survive in the hostile, craggy Keturan mountains. \"Find your father, \" the local wisewoman tells her. \"To find your true self, find the Wolverine.\" Angered by his abandonment, Kelyn doesn't care about her father - but the lure of adventure in the Out Lands calls to her, and she accepts the challenge. New languages. New weapons. Magic. Witch hunts. The treacheries of civilization. She doesn't know just how much of a challenge it'll be.</p>"; 
